import { Grid, Typography,makeStyles, Card, CardMedia, Button } from '@material-ui/core'
import React from 'react'

const useStyles = makeStyles((theme) =>({
text:{
    fontFamily:'Rosarivo',
    fontSize:'50px',
    padding:theme.spacing(3)
},
button:{
    backgroundColor:'#1B224A',
    color:'#C7DFC1',
    margin:theme.spacing(3),
    padding:'8px'

}
}))
function Home() {
    const classes=useStyles();
    return (
        <>
            <Typography variant='h1' container='h5' className={classes.text}>
                Welcome to E-commerce Page
            </Typography>
            <Button className={classes.button}>
                Explore more
            </Button>
            <Button className={classes.button}>
                Buy now
            </Button>
        </>
    )
}

export default Home
